import React from 'react';
import './App.css';
import Gifticon from './components/Gifticon';

const gifticon = [{
  'id' : 1,
  'image' : 'https://placeimg.com/64/64/any',
  'name' : '스타벅스',
  'exp_date' : '20200820',
  'used' : 'false'
},
{
  'id' : 2,
  'image' : 'https://placeimg.com/64/64/any',
  'name' : '할리스',
  'exp_date' : '20200819',
  'used' : 'true'
}]

function App() {
  return (
    <Gifticon
      id = {gifticon.id}
      gifticonimg = {gifticon.gifticonimg}
      name = {gifticon.name}
      exp_date = {gifticon.exp_date}
      used = {gifticon.used}
    />
  );
}
export default App;
